pragma solidity ^0.8.18;

import {TokenSupporter} from "./TokenSupporter.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "./interfaces/Structs.sol";

contract NFTPledging is TokenSupporter, IERC721Receiver {
    using EnumerableSet for EnumerableSet.UintSet;

    error InvalidNFT();

    mapping(address user => mapping(address nft => EnumerableSet.UintSet tokenIds)) depositedNFTs;

    function _depositNFT(address nftAddress, uint256 tokenId) internal {
        allowedToken(nftAddress);
        IERC721(nftAddress).safeTransferFrom(
            msg.sender,
            address(this),
            tokenId
        );
        depositedNFTs[msg.sender][nftAddress].add(tokenId);
    }

    function _withdrawNft(
        address owner,
        address recipient,
        address nftAddress,
        uint256 tokenId
    ) internal {
        if (!hasDepositedNFT(owner, nftAddress, tokenId)) revert InvalidNFT();
        depositedNFTs[owner][nftAddress].remove(tokenId);
        IERC721(nftAddress).safeTransferFrom(
            address(this), recipient, tokenId
        );
    }

    function hasDepositedNFT(
        address owner,
        address nftAddress,
        uint256 tokenId
    ) public view returns (bool) {
        return depositedNFTs[owner][nftAddress].contains(tokenId);
    }

    function getDepositedNFT(
        address owner,
        address nftAddress
    ) public view returns (uint256[] memory) {
        return depositedNFTs[owner][nftAddress].values();
    }

    function getDepositedNFTCount(address owner, address nftAddress)
        public view returns (uint256) {
            return depositedNFTs[owner][nftAddress].length();
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes calldata
    ) external pure override returns (bytes4) {
        return IERC721Receiver.onERC721Received.selector;
    }
}","keccak256":"0x36ba932fb97912d7f6f57b522f84885c53a6b7bb82dec1d3486aa54a97e16f5a","license":"MIT"},"contracts/TokenSupporter.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "./libraries/ChainlinkOracle.sol";
import "./interfaces/Structs.sol";
import "./utils/Constants.sol";

contract TokenSupporter is Constants {
    using ChainlinkOracle for AggregatorV3Interface;

    address[] internal supportedERC20s;
    address[] internal supportedNFTs;

    mapping(address => Structs.SupportedToken) internal supportedToken;

    error TokenNotSupported();
    error AlreadySupported();
    error InvalidTokenType(Structs.TokenType tokenType);

    event AddSupportedToken(address token, Structs.TokenType tokenType);

    function addSupportedToken(
        address token,
        address priceFeed,
        Structs.TokenType tokenType
    ) internal {
        if (supportedToken[token].supported) revert AlreadySupported();
        if (uint(tokenType) > 1) revert InvalidTokenType(tokenType);

        supportedToken[token].usdPriceFeed = priceFeed;
        supportedToken[token].tokenType = tokenType;
        supportedToken[token].supported = true;

        if (tokenType == Structs.TokenType.ERC721) {
            supportedNFTs.push(token);
        } else {
            supportedERC20s.push(token);
        }

        emit AddSupportedToken(token, tokenType);
    }

    function getTokenPrice(address token) public view returns (uint256 price) {
        if (!supportedToken[token].supported) return 0;
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            supportedToken[token].usdPriceFeed
        );
        price = priceFeed.getPrice();
    }

    function allowedToken(address token) internal view {
        if (!supportedToken[token].supported) revert TokenNotSupported();
    }
}","keccak256":"0x96c693e8569da696e98e63fbc6ded156d95e6f59d7f0b8c2ae4996636dcb4f11","license":"MIT"},"contracts/interfaces/Structs.sol":{"content":"//SPDX-License-Identifier: MIT

