    }

    struct SupportedToken {
        address usdPriceFeed;
        TokenType tokenType;
        bool supported;
    }

    struct AccountShares {
        uint256 collateral;
        uint256 borrow;
    }

    struct Vault {
        uint256 amount;
        uint256 shares;
    }

    struct TokenVault {
        Vault totalAsset;
        Vault totalBorrow;
        VaultInfo vaultInfo;
    }

    struct VaultInfo {
        uint256 reserveRatio;
        uint64 feeToProtocolRate;
        uint64 flashFeeRate;
