        uint256 optimalUtilization;
    }

    struct LiquidatedWarning {
        address liquidator;
        uint64 liquidationTimestamp;
    }

    struct VaultSetupParamemters {
        uint64 reserveRatio;
        uint64 feeToProtocolRate;
        uint64 flashFeeRate;
        uint64 baseRate;
        uint64 slope1;
        uint64 slope2;
        uint256 optimalUtilization;
    }
}","keccak256":"0x9a6b326a06bcee7cfcef4cfd680c4afa19f98541c4463a683dad54b204245f10","license":"MIT"},"contracts/libraries/ChainlinkOracle.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.8.18;

import {AggregatorV3Interface} from "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library ChainlinkOracle {
    error InvalidPrice();

    uint256 private constant TIME_OUT = 2 hours;

    uint256 private constant USD_ORACLE_DECIMALS = 10;

    function getPrice(
        AggregatorV3Interface priceFeed
    ) internal view returns (uint256 price) {
        (
            uint80 roundId,
            int256 answer,
            ,
            uint256 updatedAt,
            uint80 answerInRound
        ) = priceFeed.latestRoundData();

        if (
            answer <= 0 ||
            updatedAt == 0 ||
            answerInRound < roundId ||
            block.timestamp - updatedAt > TIME_OUT
        ) revert InvalidPrice();

        price = uint256(answer) * 10 ** USD_ORACLE_DECIMALS;
    } 

    function getTimeOut(AggregatorV3Interface) public pure returns (uint256) {
        return TIME_OUT;
    }
}","keccak256":"0xe1d6702a9e4cf5909ab52df90f7b5c1415bf90b436e246eb312114a13aed6231","license":"MIT"},"contracts/utils/Constants.sol":{"content":"// SPDX-License-Identifier: MIT
